import './styles.css';


export const Manufacturer = () => {
    return(
        <div>
            <h1>Manufacturer</h1>
            <form action="http://127.0.0.1:3000/api/getTuna" method="POST">      
          <input name="id" type="text" className="feedback-input" placeholder="Enter Product ID"  />   
          <input type="submit" value="GET"/>
        </form>  
        <a href='/'>Home</a>
        </div>
    )
}
